import React from "react";
import { Header, Container, Grid } from 'semantic-ui-react';

function Tokusatsu() {
  return (
      <Container>
        <br/>
        <Header as ="h2" textAlign="center">Japanese Tokusatsu Paper</Header>
        <Grid textAlign='center'><span className='bold-list'>2019-05-15</span> </Grid>
        <Grid textAlign='center'>Japanese, Research Paper</Grid>
        <Container text>
          <hr/>
          <b><u>Overview of JPN 421</u></b><br/>
          Japanese 421, a writing intensive course, we spent the last two month on writing a research paper
          about a topic of our choice. Since I like <i>Tokusatsu</i>, Japanese special effect shows, I did a paper
          on the history on it. 
        </Container>
      </Container>
  );
}

export default Tokusatsu;
